import React,  { useState } from "react";

function ChangeDateButtons() {
    var [month, setMonth] = useState(new Date().getMonth)
    var [year, setYear] = useState(new Date().getFullYear)

    console.log(year,"-",month)

    return [
        <h1>{month}</h1>,
        <h1>{year}</h1>
    ]





}

export {ChangeDateButtons};
